import React, { useState } from 'react';
import {Route, BrowserRouter, Switch as Router } from "react-router-dom"
import MainContainer from "./page/main/MainContainer"
function App() {
  return (
    <BrowserRouter>
        <Route exact path="/" component={MainContainer} />
    </BrowserRouter>
  );
}

export default App;
